'''Flynn''' is the owner of the [[Flynn's Mace Market]] in [[Falador]].

His shop is located between the [[Hairdresser|barbershop]] and the [[general store]] which is just west of Falador's town square. He sells [[Bronze mace|bronze]], [[Iron mace|iron]], [[Steel mace|steel]], [[Mithril mace|mithril]] and [[adamant mace]]s.

